import user from "../../Models/Db/Users/User.Model"
import * as R from "ramda"
import { findAndUpdate } from "../../Utils/Domains"

export default async function updateUser(id = null, data) {
  try {
    if (!R.isNil(id)) {
      const resp = await findAndUpdate({
        model: user,
        filter: {
          where: {
            id: id,
          },
        },
        data: data,
      })
      return resp
